The existing interfaces don't allow for the following use of ModelOptions.

```
options = <ModalOptions>{
    backdrop: forceUserInteraction ? "static" : true
};
```

Now the buttons defined in the options are typed, too.

Example:

```
  bootbox.dialog({
    title: 'Some nice title',
    message: 'And some content, too.',
    buttons: {
      fullyTypedButton: {
        label: "I am typed now!",
        classNae: "btn btn-primary", // <= Typo recognized by compiler now
        callback: function() {
        }
      }
    }
  });
```

This code would not have compiled before 

``` typescript
/// <reference path="d3.d.ts" />

var line1 = d3.svg.line().interpolate("step");
var line2 = d3.svg.line().interpolate(line1.interpolate());
```

It compiles now. 

The reason for that is described here 
https://github.com/Microsoft/TypeScript/issues/1805

In short, since the return type of interpolate is the union `string | ((points: Array<[number, number]>) => string)`, that is what the argument should look like as well. Splitting it into overloaded methods does not work until TS#1805 is closed
